ghi = data(:,1);
% sample corresponding REST2 clear-sky ghi 
ghics = data(:,2);
% sample dni data from Adelaide Airport, 
dni = data(:,3);
% sample corresponding REST2 clear-sky dni
dnics = data(:,4);
